class ActorSeeder extends Seeder
{
    private $actors = [
        [1,819, "Edward Norton", "Boston, Massachusetts, USA", "Edward Harrison Norton (born August 18, 1969) is an American actor, screenwriter, film director and producer. In 1996, his supporting role in the courtroom drama Primal Fear garnered him a nomination for the Academy Award for Best Supporting Actor. Two years later, his lead role as a reformed white power skinhead in American History X earned a nomination for Academy Award for Best Actor. His other films include period dramas such as Kingdom of Heaven (2005), The Illusionist (2006), and The Painted Veil (2006); and other notable films such as Rounders (1998), Fight Club (1999), 25th Hour (2002), Red Dragon (2002), and The Incredible Hulk (2008).In addition to acting, Norton is also a writer and director. He made his directorial debut with the film Keeping the Faith (2000) and is slated to direct the film adaptation of the novel Motherless Brooklyn. Norton did uncredited work on the scripts for The Score, Frida, and The Incredible Hulk.In his private life, Norton is an environmental and social activist. He is a member of the board of trustees of Enterprise Community Partners, a non-profit organization for developing affordable housing, founded by his grandfather, James Rouse. Norton is president of the American branch of the Maasai Wilderness Conservation Trust. He ran in the 2009 New York City Marathon to raise money for the Trust. He also raises money for charity through Crowdrise, a social networking community for volunteers and a micro-donations fundraising platform. In July 2010, Norton was designated as the United Nations Goodwill Ambassador for Biodiversityby UN Secretary-General Ban Ki-moon.", "1969-08-18", null, "male", "images/actors/5ea3c948f549243a728a22e6a536dec6.jpg"],
        [2,287, "Brad Pitt", "Shawnee, Oklahoma, USA", "William Bradley \"Brad\" Pitt (born December 18, 1963) is an American actor and film producer. Pitt has received two Academy Award nominations and four Golden Globe Award nominations, winning one. He has been described as one of the world's most attractive men, a label for which he has received substantial media attention. Pitt began his acting career with television guest appearances, including a role on the CBS prime-time soap opera Dallas in 1987. He later gained recognition as the cowboy hitchhiker who seduces Geena Davis's character in the 1991 road movie Thelma & Louise. Pitt's first leading roles in big-budget productions came with A River Runs Through It (1992) and Interview with the Vampire (1994). He was cast opposite Anthony Hopkins in the 1994 drama Legends of the Fall, which earned him his first Golden Globe nomination. In 1995 he gave critically acclaimed performances in the crime thriller Seven and the science fiction film 12 Monkeys, the latter securing him a Golden Globe Award for Best Supporting Actor and an Academy Award nomination.Four years later, in 1999, Pitt starred in the cult hit Fight Club. He then starred in the major international hit as Rusty Ryan in Ocean's Eleven (2001) and its sequels, Ocean's Twelve (2004) and Ocean's Thirteen (2007). His greatest commercial successes have been Troy (2004) and Mr. & Mrs. Smith (2005).Pitt received his second Academy Award nomination for his title role performance in the 2008 film The Curious Case of Benjamin Button. Following a high-profile relationship with actress Gwyneth Paltrow, Pitt was married to actress Jennifer Aniston for five years. Pitt lives with actress Angelina Jolie in a relationship that has generated wide publicity. He and Jolie have six children—Maddox, Pax, Zahara, Shiloh, Knox, and Vivienne.Since beginning his relationship with Jolie, he has become increasingly involved in social issues both in the United States and internationally. Pitt owns a production company named Plan B Entertainment, whose productions include the 2007 Academy Award winning Best Picture, The Departed.", "1963-12-18", null, "male", "images/actors/44f656dde3ba6065331a0eaf2ffb4a55.jpg"],
        [3,7470, "Meat Loaf", "Dallas, Texas, USA", "Michael Lee Aday (born Marvin Lee Aday; September 27, 1947), better known by his stage name, Meat Loaf, is an American rock musician and actor. He is noted for the Bat Out of Hell album trilogy consisting of Bat Out of Hell, Bat Out of Hell II: Back Into Hell and Bat Out of Hell III: The Monster Is Loose. Bat Out of Hell has sold more than 43 million copies. After more than 30 years, it still sells an estimated 200,000 copies annually, and stayed on the charts for over nine years, making it one of the best selling albums of all time. Although he enjoyed success with Bat Out of Hell and Bat Out of Hell II: Back into Hell, and earned a Grammy Award for Best Rock Vocal Performance, Solo for a track on the latter album, Meat Loaf experienced some initial difficulty establishing a steady career within his native US. However, he has retained iconic status and popularity in Europe, especially the UK, where he ranks 23rd for number of weeks overall spent on the charts. He ranked 96th on VH1's \"100 Greatest Artists of Hard Rock.\" Meat Loaf has also appeared in over 50 movies or television shows, sometimes as himself, or as characters resembling his stage persona. His most notable roles include Eddie in the American premiere of The Rocky Horror Show and in The Rocky Horror Picture Show, and Robert \"Bob\" Paulson in Fight Club.Description above from the Wikipedia article Meat Loaf, licensed under CC-BY-SA, full list of contributors on Wikipedia.", "1947-09-27", null, "male", "images/actors/0c9de4090ab48dcf4bf0366da7e0ede4.jpg"],
        [4,7499, "Jared Leto", "Bossier City, Louisiana, USA", "Jared Joseph Leto (born December 26, 1971) is an American actor and musician. He began his career as a model before studying art, and then later, film and video. Leto gained fame during his role as Jordan Catalano in My So-Called Life. He has appeared in films such as Fight Club; Girl, Interrupted; Panic Room; American Psycho; Alexander; Requiem for a Dream; Lord of War, Prefontaine, Mr. Nobody and Suicide Squad. He is the lead vocalist, rhythm guitarist and main songwriter for the American rock band 30 Seconds to Mars and has directed music videos under the pseudonym Bartholomew Cubbins.", "1971-12-26", null, "male", "images/actors/23008a9cb6ee9b0e107bfe7d43e3e233.jpg"],
        [5,1283, "Helena Bonham Carter", "Golders Green, London, England, UK", "Helena Bonham Carter (born 26 May 1966) is an English actress of film, stage, and television. She made her film debut in K. M. Peyton's A Pattern of Roses before winning her first leading role as the titular character in Lady Jane. She is known for her roles in films such as A Room with a View, Fight Club, and the Harry Potter series, as well as for frequently collaborating with director Tim Burton, her domestic partner since 2001. Bonham Carter is a two-time Academy Award nominee for her performances in The Wings of the Dove and The King's Speech; her portrayal of Queen Elizabeth in the latter film garnering her a BAFTA Award in 2011.Description above from the Wikipedia article Helena Bonham Carter, licensed under CC-BY-SA, full list of contributors on Wikipedia.", "1966-05-26", null, "female", "images/actors/8fd8e3e5f7882505e0b93ee9347d7d72.jpg"],
        [6,98285, "Bella Thorne", "Pembroke Pines, Florida, USA", "Annabella Avery 'Bella' Thorne (born October 8, 1997) is an American actress and model. An accomplished child model and actress with appearances in more than 20 films and television series and more than 40 commercials, she is best known for her role as the aspiring young dancer, CeCe Jones on the Disney Channel original series Shake It Up!.Description above from the Wikipedia article Bella Thorne, licensed under CC-BY-SA, full list of contributors on Wikipedia.", "1997-10-08", null, "female", "images/actors/6eaad6e9c99cffb0f8c758f5f50cd649.jpg"],
        [7,37089, "Cameron Monaghan", "Santa Monica, California, USA", "From Wikipedia, the free encyclopedia.Cameron Riley Monaghan (born August 16, 1993) is an American actor. Beginning his professional career as a child model at the age of three, and child actor at the age of seven, Monaghan is perhaps best known for his role as Ian Gallagher on the Showtime comedy-drama series Shameless, as well as for his feature film roles, as Kevin O'Doyle in Click (2006), Corey Doyle in Prom (2011), Mason Ashford in Vampire Academy (2014) and as Asher in The Giver (2014).", "1993-08-16", null, "male", "images/actors/d2565ac47947d902ec8f7f8d6080b45e.jpg"],
        [8,41421, "Jennifer Morrison", "Chicago, Illinois, USA", "Jennifer Marie Morrison (born April 12, 1979, height 5' 5¼ (1,66 m)) is an American actress, model and film producer. She is best known for her role as Dr. Allison Cameron in House, whom she played for over five years, and also as Zoey Pierson in the sixth season of How I Met Your Mother.Jennifer Morrison was born in Chicago, Illinois, and raised in Arlington Heights, Illinois. She is the eldest of three children with a sister, Julia, and a brother, Daniel. Her father, David L. Morrison, is a retired music teacher who was named teacher of the year by the Illinois State Board of Education in 2003. Morrison's mother, Judy Morrison, is also a retired teacher.Morrison attended South Middle School then graduated from Prospect High School in 1997 where her parents worked. She played clarinet in the school's marching band, sang in the choir and was a cheerleader with the school's pep squad. She attended Loyola University Chicago where she majored in Theatre and minored in English, graduating in 2000. She studied with the Steppenwolf Theatre Company before moving to Los Angeles to pursue a career in film and television.Morrison started dating her House co-star Jesse Spencer in July 2004. Spencer proposed to Morrison on December 23, 2006, at the Eiffel Tower and the two had planned to marry later in 2007. In August 2007, Morrison and Spencer called off their engagement.Description above from the Wikipedia article Jennifer Morrison, licensed under CC-BY-SA, full list of contributors on Wikipedia.", "1979-04-12", null, "female", "images/actors/93a6a52c797975dbda2a6409c04bcba1.jpg"],
        [9,10431, "Jennifer Jason Leigh", "Hollywood, California, USA", "Jennifer Jason Leigh (born February 5, 1962) is an American film and stage actress, best known for her roles in Fast Times at Ridgemont High, Single White Female, Last Exit to Brooklyn, Georgia and Short Cuts. She is also the co-writer and co-director of the film The Anniversary Party, made with fellow actor Alan Cumming.Leigh is known for her emotionally raw and often sexually explicit portrayals of vulnerable and damaged women, and for her intensive method inspired research into her roles.Description above from the Wikipedia article Jennifer Jason Leigh, licensed under CC-BY-SA, full list of contributors on Wikipedia.", "1962-02-05", null, "female", "images/actors/0b2b264c34a219a1c37e0e02f1740e57.jpg"],
        [10,188013, "Taylor Spreitler", "Hattiesburg, Mississippi, USA", "From Wikipedia, the free encyclopedia.Taylor Spreitler (born October 23, 1993) is an American actress and former model. Taylor portrayed the role of Mia McCormick on the NBC soap opera Days of our Lives, from January 2009 until June 2010. She recently joined the cast of the ABC Family sitcom Melissa &amp; Joey to playing the role of Lennox Scanlon.Taylor was born in Hattiesburg, Mississippi, spent her youngest years in Wiggins, Mississippi, then moved to Amory, Mississippi. She currently resides in Los Angeles.Initially a model, Spreitler later booked her first commercial audition, a national campaign for Motrin. This was followed by a series of spots, including JIF, Hess, and Chuck E. Cheese's.An accomplished singer, Spreitler sang during a pre-game show for the Liberty Bowl on ESPN.In January 2009, Spreitler signed a three year contract to play the role of Mia McCormick on the NBC daytime soap Days of our Lives. Her last episode aired at the end of June 2010 after she was released from her contract.Taylor plays Lennox Scanlon, a main character in ABC Family's Melissa &amp; Joey, who is the niece of Mel Burke.Description above from the Wikipedia article Taylor Spreitler, licensed under CC-BY-SA, full list of contributors on Wikipedia.", "1993-10-23", null, "female", "images/actors/1fa600133f8fad5454f2320e8ba5a0ab.jpg"],
        [11,929937, "Stephanie Sigman", "Obregon - Sonora - Mexico", "Stephanie Sigman is an actress.", "1987-08-20", null, "female", "images/actors/c606146cfe4da590001b33fb27218afe.jpg"],
        [12,1379123, "Talitha Bateman", "Turlock, California, USA", "Talitha Bateman is an American child actress, best known for playing the leading role in Annabelle: Creation, Teacup in The 5th Wave, and the leading role, Heidi, in So B. It. Wikipedia", "2001-09-04", null, "female", "images/actors/b74cd643272d1a5466ed74f2360c7421.jpg"],
        [13,57829, "Anthony LaPaglia", "Adelaide, Australia", "​From Wikipedia, the free encyclopedia.Anthony M. LaPaglia (born 31 January 1959) is an Australian actor. He is known for his role as FBI agent Jack Malone on the American TV series Without a Trace, for which he won a Golden Globe Award for Best Actor – Television Series Drama and was nominated for a Primetime Emmy Award for Outstanding Lead Actor in a Drama Series; and for his portrayal of Simon Moon on the TV show Frasier.Description above from the Wikipedia article Anthony LaPaglia, licensed under CC-BY-SA, full list of contributors on Wikipedia", "1959-01-31", null, "male", "images/actors/0085a9b60c863e370ee20cb4420efe1f.jpg"],
        [14,502, "Miranda Otto", "Brisbane, Queensland, Australia", "Miranda Otto  (born 16 December 1967) is an Australian actress. The daughter of actors Lindsay and Barry Otto and the sister of actress Gracie Otto, she began acting at age eighteen, and has performed in a variety of independent and major studio films. Her first major film appearance was in the 1986 film Emma's War, in which she played a teenager who moves to Australia's bush country during World War II. After a decade of critically acclaimed roles in Australian films, she gained Hollywood's attention after appearing in supporting roles in The Thin Red Line (1998) and What Lies Beneath (2000). Her breakthrough role came in 2002, when she portrayed Éowyn in The Lord of the Rings trilogy. More recent work includes a starring role in the 2008 now-cancelled American television series Cashmere Mafia, and Australian films such as In Her Skin and Blessed (2009).Description above from the Wikipedia article Miranda Otto, licensed under CC-BY-SA, full list of contributors on Wikipedia", "1967-12-16", null, "female", "images/actors/9c681715fc20834cb3ba9e05d5859897.jpg"],
        [15,98946, "Lulu Wilson", "", "", "2017-08-20", null, "female", "images/actors/606258369b07080b925869955cbeec7b.jpg"],
        [16,6885, "Charlize Theron", "Benoni, Gauteng, South Africa", "Charlize Theron (born 7 August 1975) is a South African actress, film producer and former fashion model.She rose to fame in the late 1990s following roles in the films The Devil's Advocate (1997), Mighty Joe Young (1998), and The Cider House Rules (1999). Theron received critical acclaim for her portrayal of serial killer Aileen Wuornos in Monster (2003), for which she won the Silver Bear, Golden Globe Award, Screen Actors Guild Award, and Academy Award for Best Actress among several other accolades, becoming the first South African to win an Academy Award in a major acting category. In recent years, she has moved into the field of producing, both in television and film.She received further Academy Award and Golden Globe Award nominations for her performance in North Country in 2005, and a Golden Globe Award nomination for her performance in Young Adult in 2011. In 2012, she appeared in Snow White &amp; the Huntsman and Prometheus, both of which were box office successes. Theron became a U.S. citizen in 2007, while retaining her South African citizenship.Theron was born in Benoni, in the then-Transvaal Province of South Africa, the only child of Gerda (née Maritz) and Charles Theron (born 27 November 1947). Second Boer War figure Danie Theron was her great-great-uncle. Her ancestry includes French, German, and Dutch; her French forebears were early Huguenot settlers in South Africa. \"Theron\" is an Occitan surname (originally spelled Théron) pronounced in Afrikaans as [tɜːron], although she has said that the way she pronounces it in South Africa is [θron]. She changed the pronunciation when she moved to the U.S. to give it a more \"American\" sound.She grew up on her parents' farm in Benoni, near Johannesburg. On 21 June 1991, Theron's father, an alcoholic, physically attacked her mother and threatened both her mother and her while drunk; Theron's mother then shot and killed him. The shooting was legally adjudged to have been self-defense and her mother faced no charges.Theron attended Putfontein Primary School (Laerskool Putfontein), a period she later characterised as not \"fitting in\". At 13, Theron was sent to boarding school and began her studies at the National School of the Arts in Johannesburg. Although Theron is fluent in English, her first language is Afrikaans.", "1975-08-08",null, "female", "images/actors/6cef35f694a5c9886f73fa8d127e1c3a.jpg"],
        [17,5530, "James McAvoy", "Port Glasgow, Scotland, UK", "James Andrew McAvoy  (born 21 April 1979) is a Scottish stage and screen actor. His best-known work includes the films The Last King of Scotland and Atonement, both of which earned him BAFTA Award nominations, and the TV series Shameless. McAvoy has won the BAFTA Rising Star Award and a BAFTA Scotland award. He has also been nominated for an ALFS Award, a European Film Award, and a Golden Globe award.", "1979-04-21", null, "male", "images/actors/d44caa1581496ceb2a0725a85cb45bbf.jpg"],
        [18,1230, "John Goodman", "St. Louis, Missouri, USA", "​American actor. Height 6' 2 (1,88 m)John Goodman is most famous for his role on the television series Roseanne. He is also a well known film and stage actor. Goodman comes from Affton, Missouri where he showed an early interest in film. A football scholarship took John to Southwest Missouri State University where he continued his acting education. A college injury ended his football dreams, so Goodman moved to Manhattan in pursuit of an acting career. He eventually performed on Broadway and appeared in several commercials. By the early 1980's John started landing small movie roles, including Eddie Macon's Run, and The Survivors (both in 1984). In 1990 Arachnophobia earned John a nomination for a Saturn Award for Best Supporting Actor. John then starred in the hugely popular 1998 film, The Big Lebowski which lead to a repeat nomination for Best Supporting Actor. Despite his moderate film success, Goodman is most widely know for playing Dan Conner on the TV sitcom Roseanne. Between 1988 and 1997, 221 episodes of Roseanne were filmed and John received numerous awards for his performance.Goodman met his wife, Annabeth Hartzog, while filming Everybody's All-American (1988). The two were married in October 1989, and had daughter Molly in 1990. John admits once having a long-time alcohol problem, but has reportedly been clean since 2007.", "1952-06-20", null, "male", "images/actors/2ca833f384b82a6bc3d084bb36992060.jpg"],
        [19,1844, "Til Schweiger", "Freiburg im Breisgau, Germany", "Tilman Valentin 'Til' Schweiger ( born December 19, 1963) is a German actor, director, and producer. He is one of Germany’s most successful filmmakers. Since 1968, when the FFA started counting, no other German actor drew more people to the cinemas. He runs his own production company Barefoot Films in Berlin.", "1963-12-19", null, "male", "images/actors/af4097470d152aefd6365914f46c9ae4.jpg"],
        [20,1665, "Eddie Marsan", "Stepney, East London, England", "​From Wikipedia, the free encyclopediaEdward Maurice C. 'Eddie' Marsan(born 1968) is an English actor.Description above from the Wikipedia article Eddie Marsan, licensed under CC-BY-SA, full list of contributors on Wikipedia.", "1968-06-23", null, "male", "images/actors/7f8d4bc3fe68944ddd9df4d4494aa0d4.jpg"],
        [21,887, "Owen Wilson", "Dallas - Texas - USA", "Owen Cunningham Wilson (born November 18, 1968) is an American actor and screenwriter from Dallas, Texas. His older brother, Andrew and younger brother, Luke, are also actors. He has had a long association with filmmaker Wes Anderson, having shared co-writing and acting credits for Bottle Rocket (1996) and The Royal Tenenbaums (2001), which was nominated for an Academy Award for Best Original Screenplay, and for his collaborations with fellow actor Ben Stiller. The two have appeared in ten films together.Wilson is best known for his roles in Meet the Parents (2000), Shanghai Noon (2000), Zoolander (2001), Shanghai Knights (2003), Wedding Crashers (2005), Night at the Museum (2006), Cars (2006), Marley &amp; Me (2008), Night at the Museum: Battle of the Smithsonian (2009), Midnight in Paris (2011), Cars 2 (2011) and The Internship (2013).", "1968-11-18", null, "male", "images/actors/7d6b3b78712984c2f048e764e71be4c4.jpg"],
        [22,1374727, "Cristela Alonzo", "Hidalgo, Texas, U.S.", "Cristela Alonzo is an American stand-up comedian, actress, writer and producer, who created and starred in the ABC sitcom Cristela. She is the first Mexican American woman to create, produce, write, and star in her own US network show.", "1979-01-06", null, "female", "images/actors/e80d18b4363178e252739f886aa854a5.jpg"],
        [23,2955, "Chris Cooper", "Kansas City, Missouri, USA", "Christopher W. 'Chris' Cooper (born July 9, 1951) is an American film actor. He became well known in the late 1990s, having appeared in supporting performances in several major Hollywood films, including The Bourne Identity, American Beauty, Capote, The Town, The Kingdom, Syriana, October Sky, Seabiscuit, and Adaptation, for which he won both the Academy Award and Golden Globe Award for Best Supporting Actor.Description above from the Wikipedia article Chris Cooper (actor), licensed under CC-BY-SA, full list of contributors on Wikipedia", "1951-07-09", null, "male", "images/actors/c41d93ec48ecf9f832ea9e1b5ed2168b.jpg"],
        [24,53807, "Armie Hammer", "Los Angeles, California, U.S.", "Armand Douglas 'Armie' Hammer (born August 28, 1986) is an American actor. After appearing on television and playing the title role in 2008's Billy: The Early Years, he became known for his portrayal of the Winklevoss twins in the 2010 film The Social Network. His notorious film roles include Clyde Tolson in J. Edgar, Prince Albert Alcott in Tarsem Singh's Snow White, and The Lone Ranger.", "1986-08-28", null, "male", "images/actors/0fa5b4aee770c5bfacceb42937218b57.jpg"],
        [25,5149, "Bonnie Hunt", "Chicago, Illinois, USA", "From Wikipedia, the free encyclopediaBonnie Lynne Hunt (born September 22, 1961) is an American actress, comedian, writer, director, television producer and daytime television host.Description above from the Wikipedia article Bonnie Hunt, licensed under CC-BY-SA, full list of contributors on Wikipedia.", "1961-09-22", null, "female", "images/actors/9d0f4a572c0edd76e52364d3480dd6df.jpg"],
        [26,90633, "Gal Gadot", "Rosh Ha'ayin, Israel", "Gal Gadot is an Israeli actress and model. She was born in Rosh Ha'ayin, Israel, to an Ashkenazi Jewish family (from Poland, Austria, Germany, and Czechoslovakia). She served in the IDF for two years, and won the Miss Israel title in 2004.Gal began modeling in the late 2000s, and made her film debut in the fourth film of the Fast and Furious franchise, Fast & Furious (2009), as Gisele, an associate of the film's lead villain. Her role was expanded in the sequels Fast Five (2011) and Fast & Furious 6 (2013), in which her character was romantically linked to Han Seoul-Oh (Sung Kang). In the films, Gal performed her own stunts. She also appeared in the 2010 films Date Night (2010) and Knight and Day (2010). In early December 2013, Gal was cast as Wonder Woman in the upcoming superhero team-up film Batman v Superman: Dawn of Justice (2016), with filming beginning in 2014 for a May 2016 release.Gal is a motorcycle enthusiast, and owns a black 2006 Ducati Monster-S2R. She has been married to Yaron Versano since September 28, 2008. They have one child.", "1985-04-30", null, "female", "images/actors/40461ee0e1ea0df52ab6d404d1e1ecbb.jpg"],
        [27,62064, "Chris Pine", "Los Angeles, California, USA", "Christopher Whitelaw \"Chris\" Pine (born August 26, 1980) is an American actor. He has appeared in the romantic comedies The Princess Diaries 2: Royal Engagement (2004) and Just My Luck (2006), as well as the action films Smokin' Aces (2007) and Unstoppable (2010). In 2009, he portrayed James T. Kirk in the film Star Trek.", "1980-08-26", null, "male", "images/actors/223e444f604c97e5aabc5df28b4c8d66.jpg"],
        [28,32, "Robin Wright", "Dallas, Texas, USA", "Robin Gayle Wright (born April 8, 1966) is an American actress. She is best known for her roles as Jenny Curran in Forrest Gump, as Buttercup in The Princess Bride, and as Mary Surratt in The Conspirator. She has also been credited as Robin Wright Penn.Description above from the Wikipedia article Robin Wright, licensed under CC-BY-SA, full list of contributors on Wikipedia.", "1966-04-08", null, "female", "images/actors/7419052bdf74ad530f21f4df75409b79.jpg"],
        [29,6413, "Danny Huston", "Rome, Italy", "Daniel \"Danny\" Huston (born May 14, 1962) is an American actor and director.Description above from the Wikipedia article Danny Huston, licensed under CC-BY-SA, full list of contributors on Wikipedia.", "1962-05-14", null, "male", "images/actors/ce81a32eed09c04f198306138d83da76.jpg"],
        [30,11207, "David Thewlis", "Blackpool, Lancashire, England, UK", "​David Thewlis (born 20 March 1963) is an English film, television and stage character actor, as well as a writer.Description above from the Wikipedia article David Thewlis, licensed under CC-BY-SA, full list of contributors on Wikipedia.", "1963-03-20", null, "male", "images/actors/8235489d098e5ef3f1b7108ca3265ed6.jpg"],
        [31,18918, "Dwayne Johnson", "Hayward, California, USA", "Dwayne Douglas Johnson (born May 2, 1972), also known by his ring name The Rock, is an American and Canadian actor, producer and semi-retired professional wrestler, signed with WWE. ", "1972-05-02", null, "male", "images/actors/7165d96ce1c250ce07918f80dcbab8f8.jpg"],
        [32,29222, "Zac Efron", "San Luis Obispo, California, USA", "Zachary David Alexander \"Zac\" Efron (born October 18, 1987) is an American actor, singer, and dancer. He began acting professionally in the early 2000s, and became known to young audiences after his roles in the Disney Channel Original Movie High School Musical, the WB series Summerland, and the 2007 film version of the Broadway musical Hairspray. In 2007, before the release of High School Musical 2, Rolling Stone declared him the poster boy for tweenyboppers and featured him in their late August 2007 issue. Efron has since starred in the films 17 Again, Me and Orson Welles, and Charlie St. Cloud, and is due to star in New Year's Eve and The Lucky One.Description above from the Wikipedia article Zac Efron, licensed under CC-BY-SA, full list of contributors on Wikipedia​", "1987-10-18", null, "male", "images/actors/3606bc677df9c105b14e0894d6aac9c3.jpg"],
        [33,109513, "Alexandra Daddario", "New York City, New York, USA", "Alexandra Anna Daddario (born March 16, 1986) is an American actress, known to film audiences as Annabeth Chase in the 2010 film Percy Jackson &amp; the Olympians: The Lightning Thief. Daddario was also in The Squid and the Whale, All My Children, The Babysitters, The Attic, The Hottest State, White Collar, It's Always Sunny in Philadelphia, and Bereavement. She will star as the protagonist \"Heather Miller\" in the 2013 horror film Texas Chainsaw 3D.", "1986-03-16", null, "female", "images/actors/dbb58b2ef22032246021f2b81b132c76.jpg"],
        [34,1156913, "Kelly Rohrbach", "Connecticut, U.S.A.", "Kelly Rohrbach is an actress.", "1990-01-21", null, "female", "images/actors/b02a55428e8ccb1a90b79252e7e33337.jpg"],
        [35,77234, "Priyanka Chopra", "Jamshedpur, Jharkand, India", "​Priyanka Chopra is an Indian actress and former Miss World. Before starting her acting career, she worked as a model and gained fame after winning the Miss World title in 2000. She is often referred to by the nickname \"Piggy Chops\", which was given to her by co-stars on the set of the film Bluffmaster! Chopra made her acting debut with the 2002 Tamil film Thamizhan. The following year, she made her Bollywood film debut with The Hero: Love Story of a Spy and followed it with the hit Andaaz, for which she won a Filmfare Best Female Debut Award. In 2004, she became the second woman to win the Filmfare Best Villain Award, which she received for her critically acclaimed performance in Aitraaz. Chopra would later have commercial success with films like Mujhse Shaadi Karogi (2004), Krrish (2006) and Don – The Chase Begins Again. In 2008, Chopra received a National Film Award for Best Actress, as well as a Filmfare Award for Best Actress for her portrayal of a model in Fashion and has thus established herself as one of the leading contemporary actresses in Bollywood.", "1982-07-18", null, "female", "images/actors/5df5ad383a9601545d6220d5cfd6406c.jpg"],
        [36,1687041, "Fionn Whitehead", "", "", "2017-08-20", null, "male", "images/actors/052bcf566bf0b8f8464f71b0fe79e0dc.jpg"],
        [37,1765227, "Tom Glynn-Carney", "", "", "2017-08-20", null, "male", "images/actors/698cd6b78dd4bbdb3f35bac3713d6d52.jpg"],
        [38,1334638, "Jack Lowden", "Chelmsford, Essex, England, UK", "Jack Lowden, born in England, raised in Scotland, is a rising stage, television, and film actor.", "1990-06-02", null, "male", "images/actors/f7251b7830e4dda8be98aa21107646c6.jpg"],
        [39,1052109, "Harry Styles", "Redditch, Worcestershire, England", "Harry Edward Styles (born 1 February 1994) is an English pop singer and actor, known as a member of the boy band One Direction. He made his debut as a singer with his band White Eskimo, who performed locally in Holmes Chapel, Cheshire, England. In 2010, Styles auditioned as a solo artist for the British television series The X Factor. After being eliminated as a solo performer, Styles was brought back into the competition, along with four other contestants, to form the group that would later become known as One Direction. On 23 June 2016 it was reported by Billboard that Styles had signed a 3-album solo recording deal with Columbia Records, the same label behind One Direction. Styles will make his feature film acting debut in the war drama Dunkirk in July 2017.", "1994-02-01", null, "male", "images/actors/567ed039f5f419d34d824c4949b8b0de.jpg"],
        [40,145143, "Aneurin Barnard", "Ogwr, Mid Glamorgan, Wales", "Aneurin Barnard (born 8 May 1987) is a Welsh television, stage and film actor. He is bilingual and has performed in both Welsh language and English language productions.He trained at the Royal Welsh College of Music &amp; Drama in Cardiff.", "1987-05-08", null, "male", "images/actors/5f334b7e2ad8f9e5dbdd92c7e005f01b.jpg"],
        [41,51990, "T.J. Miller", "Denver, Colorado, U.S.", "Todd Joseph Miller, better known as T. J. Miller, is an American actor and stand-up comedian. He starred as Erlich Bachman in the HBO sitcom Silicon Valley. Miller has also performed in such films as Cloverfield (2008), Yogi Bear (2010), How to Train Your Dragon (2010), How to Train Your Dragon 2 (2014), Transformers: Age of Extinction (2014), Big Hero 6 (2014) and Deadpool (2016).", "1981-06-04", null, "male", "images/actors/397b1e88534f1fbeb116ebfdfd9ee12c.jpg"],
        [42,55466, "James Corden", "High Wycombe, Buckinghamshire, England, UK", "James Kimberley Corden (born 17 June 1978) is an English actor, television writer, producer and presenter. He is co-creator and star of BBC comedy shows Gavin & Stacey and Horne & Corden, and acted in the 2009 film Lesbian Vampire Killers.Description above from the Wikipedia article James Corden, licensed under CC-BY-SA, full list of contributors on Wikipedia.", "1978-06-17", null, "male", "images/actors/9c83463d9ae0cddcb57613a77a1bd665.jpg"],
        [43,1772, "Anna Faris", "Baltimore, Maryland, USA", "From Wikipedia, the free encyclopedia.Anna Kay Faris (born November 29, 1976 height 5' 4 (1,63 m)) is an American actress and singer. She is known for her comedic roles in the Scary Movie film series, Lost in Translation, The House Bunny, Brokeback Mountain, My Super Ex-Girlfriend, Cloudy with a Chance of Meatballs, Yogi Bear, What's Your Number?, The Dictator, and I Give It a Year.Anna Kay Farisborn November 29, 1976) is an American actress and singer. She is known for her comedic roles in the Scary Movie film series, Lost in Translation, The House Bunny, Brokeback Mountain, My Super Ex-Girlfriend, Cloudy with a Chance of Meatballs, Yogi Bear, What's Your Number?, The Dictator, and I Give It a Year.Early lifeFaris was born in Baltimore, Maryland. Her family moved to Edmonds, Washington when she was six years old Her father, Jack, was a sociologist who worked at the University of Washington as a vice president of internal communicationsand later headed the Washington Biotechnology and Biomedical Association, and her mother, Karen, was a special education teacher at Seaview Elementary School in Edmonds. Faris has an older brother, Robert, who is also a sociologist and a professor at the University of California, Davis.Her parents encouraged her to pursue acting when she was young, and she gave her first professional acting performance at the age of 9 in a three-month run of Arthur Miller's one-act play Danger: Memory! at the Seattle Repertory Theater. She went on to play Scout in a production of To Kill a Mockingbird at the Issaquah, Washington, Village Theatre, and played the title character in Heidi and Rebecca in Our Town. While attending Edmonds-Woodway High School, Faris appeared in a frozen-yogurt TV commercial. After graduating from high school in 1994, Faris attended the University of Washington and earned a degree in English literature.Around this time,\"my third or fourth job was a training video for Red Robin, which is a burger chain out West. I play, like, the perfect hostess. And I think they still use it,\" she said in May 2012.Personal lifeWhile filming Lovers Lane in London, Faris met her first husband, Ben Indra. They began dating in that year and were married in June 2004, but they divorced in April 2007, citing irreconcilable differences.As part of their divorce agreement, which was finalized in February 2008, Faris agreed to pay Indra $900,000 in addition to other property and acting royalties. Faris met her second husband, actor Chris Pratt, on the set of Take Me Home Tonight. They became engaged in January, and married on July 9, 2009 in a small ceremony in Bali. The couple has a baby boy named Jack.", "1976-11-29", null, "female", "images/actors/60816bb15db086ab97daa692b34fbf0a.jpg"],
        [44,52792, "Maya Rudolph", "Gainesville, Florida, USA", "From Wikipedia, the free encyclopedia.Maya Khabira Rudolph (born July 27, 1972, height 5' 7 (1,70 m)) is an American actress and comedienne known for her comedic roles as a cast member on Saturday Night Live from 2000–2007 and for appearing in films such as Away We Go, Bridesmaids, Grown Ups and MacGruber. She is the daughter of the late R&B and soul singer Minnie Riperton.", "1972-07-27", null, "female", "images/actors/79ca34536476ec45468a53e4dfc982e3.jpg"],
        [45,3214, "Steven Wright", "New York City, New York, USA", "From Wikipedia, the free encyclopedia.  Steven Alexander Wright (born December 6, 1955) is an American comedian, actor and writer. He is known for his distinctly lethargic voice and slow, deadpan delivery of ironic, philosophical and sometimes nonsensical jokes and one-liners with contrived situations.Description above from the Wikipedia article Steven Wright, licensed under CC-BY-SA, full list of contributors on Wikipedia.", "1955-12-06", null, "male", "images/actors/1f89c4e780d57817d1c3e7e183381c27.jpg"],
        [46,4495, "Steve Carell", "Concord, Massachusetts, USA", "Steven John \"Steve\" Carell (born August 16, 1962) is an American actor, comedian, voice artist, producer, director and writer. Carell became famous for his roles in the television series The Daily Show with Jon Stewart from 1999 to 2004, and The Office from 2005 onwards. He has also starred in several Hollywood films, including Anchorman, The 40-Year-Old Virgin, Little Miss Sunshine, Evan Almighty, Dan in Real Life, Get Smart, Date Night and Dinner for Schmucks; and voiced characters in the animated films Over the Hedge, Horton Hears a Who!, and Despicable Me. Carell was nominated as \"America's funniest man\" in Life magazine. He received the Golden Globe Award for Best Actor in the Television Comedy Series for his lead role of Michael Scott for the American television series The Office during 2006.  Carell is married to Saturday Night Live alumna Nancy Carell, whom he met when she was a student in an improvisation class he was teaching at Second City. They have two children, Elisabeth Anne \"Annie\" (born May 25, 2001) and John \"Johnny\" (born June 2004). Nancy acted with him on The Office as his realtor and short-lived girlfriend Carol Stills, and also cameoed as a sex therapist in The 40 Year Old Virgin. The Carells have a home in Marshfield, Massachusetts. He recently helped to preserve some of the town's history by purchasing the 155-year-old Marshfield Hills General Store, an antique country store well-known for its candy counter. ​", "1962-08-16", null, "male", "images/actors/d77c047ea385cd3517c1affd378390ca.jpg"],
        [47,41091, "Kristen Wiig", "Canandaigua, New York, USA", "Kristen Carroll Wiig (born August 22, 1973) is an American film and television actress who currently appears as a cast member on Saturday Night Live. Wiig is a member of improvisational comedy troupe The Groundlings, and has appeared in several films and television series, including MacGruber, Flight of the Conchords, Adventureland, Walk Hard: The Dewey Cox Story and Paul. She was also the voice of Ruffnut in How to Train Your Dragon and Miss Hatie in Despicable Me and she is the voice of Lola Bunny in the series The Looney Tunes Show.", "1973-08-22", null, "female", "images/actors/65362ac5cdb1b5e6d87fe3d7ae020c53.jpg"],
        [48,34517, "Trey Parker", "Conifer, Colorado, USA", "From Wikipedia, the free encyclopediaTrey Parker (born Randolph Severn Parker III; October 19, 1969) is an American animator, screenwriter, director, producer, voice artist, musician and actor, best known for being the co-creator of the television series South Park along with his creative partner and best friend Matt Stone.Parker started his film career in 1992, making a holiday short titled Jesus vs. Frosty. His first success came from Cannibal! The Musical. From there he made another short titled Jesus vs. Santa, which led him and his college friend, Matt Stone, to create the animated television series South Park, which has been on television for over a decade. He has won 4 Emmy Awards for his role in South Park, winning for both \"Outstanding Programming More Than One Hour\" and \"Outstanding Programming Less Than One Hour\".Description above from the Wikipedia article Trey Parker, licensed under CC-BY-SA, full list of contributors on Wikipedia.", "1969-10-19", null, "male", "images/actors/efbcc082c055c880981ecea0eff255e7.jpg"],
        [49,17743, "Miranda Cosgrove", "Los Angeles, California, USA ", "Miranda Taylor Cosgrove (born May 14, 1993) is an American actress, singer and songwriter. Her career began at the age of 3 with several television commercial appearances. Cosgrove's film debut came in 2003, when she appeared as Summer Hathaway in School of Rock. She appeared in a number of minor television roles over several years before coming to prominence as Megan Parker on the Nickelodeon television series Drake &amp; Josh. In 2007, she landed the role of Carly Shay, the lead character on the Nickelodeon teen sitcom iCarly, on which she starred until 2012.As of May 2010, Cosgrove earned $180,000 per episode of iCarly, making her the second-highest-paid child star on television, and in 2012 was listed in the Guinness World Records as the highest paid child actress. Cosgrove also voiced Margo in the animated film Despicable Me (2010) and its 2013 sequel. That year, Cosgrove was cast in an NBC television pilot titled Girlfriend in a Coma, which didn't materialize after Christina Ricci left the production. In 2016, she starred on the short-lived NBC sitcom Crowded.Description above from the Wikipedia article Miranda Cosgrove, licensed under CC-BY-SA, full list of contributors on Wikipedia.", "1993-05-14", null, "female", "images/actors/1d0e4d82884b8e91cb1217954f36a95b.jpg"],
        [50,124750, "Dana Gaier", "New Jersey, USA", "", "1997-02-05", null, "female", "images/actors/a3de9c8480a046d626ac95b1fa3919aa.jpg"],
        [51,1245, "Scarlett Johansson", "New York City, New York, USA", "Scarlett Johansson, born November 22, 1984, is an American actress, model and singer. She made her film debut in North (1994) and was later nominated for the Independent Spirit Award for Best Female Lead for her performance in Manny &amp; Lo (1996), garnering further acclaim and prominence with roles in The Horse Whisperer (1998) and Ghost World (2001). She shifted to adult roles with her performances in Girl with a Pearl Earring (2003) and Sofia Coppola's Lost in Translation (2003), for which she won a BAFTA award for Best Actress in a Leading Role; both films earned her Golden Globe Award nominations as well.A role in A Love Song for Bobby Long (2004) earned Johansson her third Golden Globe for Best Actress nomination. Johansson garnered another Golden Globe nomination for Best Supporting Actress with her role in Woody Allen's Match Point (2005). She has played the Marvel comic book character Black Widow/Natasha Romanoff in Iron Man 2 (2010), The Avengers (2012), and Captain America: The Winter Soldier (2014) and is set to reprise the role in Avengers: Age of Ultron (2015). The 2010 Broadway revival of Arthur Miller's A View From the Bridge won Johansson the Tony Award for Best Performance by a Featured Actress in a Play. As a singer, Johansson has released two albums, Anywhere I Lay My Head and Break Up.Johansson is considered one of Hollywood's modern sex symbols, and has frequently appeared in published lists of the sexiest women in the world, most notably when she was named the \"Sexiest Woman Alive\" by Esquire magazine in both 2006 and 2013 (the only woman to be chosen for the title twice), and the \"Sexiest Celebrit\" by Playboy magazine in 2007.Johansson was born in New York City. Her father, Karsten Johansson, is a Danish-born architect, and her paternal grandfather, Ejner Johansson, was a screenwriter and director. Her mother, Melanie Sloan, a producer, comes from an Ashkenazi Jewish family from the Bronx. Johansson has an older sister, Vanessa, who is an actress; an older brother, Adrian; a twin brother, Hunter (who appeared in the film Manny &amp; Lo with Scarlett); and a half-brother, Christian, from her father's re-marriage.", "1984-11-22", null, "female", "images/actors/513ec83b6f2a8e17fc9b7be1c21bd1ac.jpg"],
        [52,1226302, "Jillian Bell", "", "", "2017-08-20", null, "female", "images/actors/435c3fde633095b062e2b4219d7b3c2a.jpg"],
        [53,1325716, "Ilana Glazer", "", "", "1987-04-27", null, "female", "images/actors/e173bc4c8970986721f95983fe853dc7.jpg"],
        [54,37153, "Zoë Kravitz", "Los Angeles, California, USA", "Zoë Isabella Kravitz (born December 1, 1988) is an American actress, singer and model. She is the only child of musician Lenny Kravitz and actress Lisa Bonet. She has appeared in the films No Reservations (2007), The Brave One (2007), and as Angel Salvadore in the superhero film X-Men: First Class (2011). Kravitz played Pearl on season four of the Showtime television series Californication, and co-starred in After Earth, with Will and Jaden Smith, directed by M. Night Shyamalan. She appeared as Christina in the 2014 dystopian film, Divergent.", "1988-12-01", null, "female", "images/actors/ca92bf1087f10fa57f87aefeb76b37ac.jpg"],
        [55,1240487, "Kate McKinnon", "Sea Cliff, New York, USA", "Kathryn McKinnon Berthold (born January 6, 1984), known professionally as Kate McKinnon, is an American actress, voice actress, and comedian. She is best known for her sketch comedy work as a cast member on Saturday Night Live and The Big Gay Sketch Show. She played Jillian Holtzmann in the reboot of Ghostbusters (2016).McKinnon is known for her strong character work and celebrity impressions. She is known for her impressions of pop singer Justin Bieber, comedian and television host Ellen DeGeneres, politician Hillary Clinton and German Chancellor Angela Merkel. She has been nominated for four Primetime Emmys, three for Outstanding Supporting Actress in a Comedy Series and one for Outstanding Original Music and Lyrics.", "1984-01-06", null, "female", "images/actors/818fed0ba09408205bf9b9cdcfb9bf1e.jpg"],
        [56,221944, "Katie Aselton", "Milbridge - Maine - USA", "Kathryn \"Katie\" Aselton is an American film director, producer, and actress from Milbridge, Maine. She is married to her co-star on The League, Mark Duplass.", "1978-10-01", null, "female", "images/actors/4d63c4918788cbd67d0a3f1407a8f806.jpg"],
        [57,3051, "Toni Collette", "Sydney, New South Wales, Australia", "From Wikipedia, the free encyclopedia.Antonia \"Toni\" Collette (born 1 November 1972) is an Australian actress and musician, known for her acting work on stage, television and film as well as a secondary career as the lead singer of the band Toni Collette &amp; the Finish.Collette's acting career began in the early 1990s with comedic roles in films such as Spotswood (1992) and Muriel's Wedding (1994), for which she was nominated for a Golden Globe Award for Best Actress. Following her performances in Emma (1996) and The Boys (1998), Collette achieved international recognition as a result of her Academy Award-nominated portrayal of Lynn Sear in The Sixth Sense (1999). She has appeared in thrillers such as Shaft (2000) and Changing Lanes (2002) and independent comedy films like About a Boy (2002), In Her Shoes (2005) and Little Miss Sunshine (2006).In 2009, she began playing the lead role in the television series United States of Tara, for which she won a Primetime Emmy Award and a Golden Globe Award for Best Actress – Television Series Musical or Comedy in 2010.", "1972-11-01", null, "female", "images/actors/5004d700d0d68984adfe63f793067ac4.jpg"],
        [58,1486957, "Bridget Everett", "", "", "2017-08-20", null, "female", "images/actors/84eeecbcd51ab16a59a30c7f82cda86d.jpg"],
        [59,28640, "Molly Shannon", "Shaker Heights, Ohio, USA", "From Wikipedia, the free encyclopedia.Molly Helen Shannon (born September 16, 1964) is an American comic actress best known for her work as a cast member on Saturday Night Live from 1995–2001 and for starring in the films Superstar and Year of the Dog. More recently, she starred in NBC's Kath &amp; Kim from 2008–2009 and on the TBS animated series Neighbors from Hell.Description above from the Wikipedia article Molly Shannon, licensed under CC-BY-SA, full list of contributors on Wikipedia", "1964-09-16", null, "female", "images/actors/9bf4b6f4045a827416719f6fb91642fd.jpg"],
        [60,36801, "Adam Scott", "Santa Cruz - California - USA", "Adam Scott (born April 3, 1973) is an American actor, producer, screenwriter, director and podcaster. He is best known for his roles as Ben Wyatt in the NBC comedy Parks and Recreation, Henry Pollard in the Starz comedy series Party Down, Palek in the HBO drama Tell Me You Love Me and Derek Huff in the 2008 film Step Brothers. He has appeared in the Adult Swim comedy Childrens Hospital. He was also on the show NTSF:SD:SUV::, and the annual Adult Swim special The Greatest Event in Television History, which he also created and produced. Scott is the co-host and co-creator of the Earwolf podcast U Talkin' U2 To Me? with Scott Aukerman.", "1973-04-03", null, "male", "images/actors/4c5d2854ea4a888807940c327fbaa967.jpg"],
        [61,1525047, "Dacre Montgomery", "", "", null, null, "female", "images/actors/e5f35b7e4d1e38710c119e2d9d1ace8c.jpg"],
        [62,109438, "Xavier Samuel", "Hamilton, Victoria, Australia", "Samuel was born in Hamilton, Victoria, the son of Maree and Clifford Samuel. He grew up in Adelaide, South Australia and graduated from Rostrevor College in 2001. He has a younger brother, Benedict, a writer, producer and actor, as well as an older sister, Bridget, a stage manager.  Despite completing his senior secondary years at Rostrevor College, Samuel undertook final year drama at Christian Brothers College under the tutelage of Amanda Portus, where he played the part of Tom Snout (the wall) in Rostrevor College's production ofShakespeare's A Midsummer Night's Dream as well as playing \"Belvile\" in CBC's production of Aphra Behn's The Rover (The Banished Cavaliers).  Xavier Samuel later attended Flinders University Drama Centre in 2005, where he studied under renowned acting teacher Professor Julie Holledge. He played Hamlet in the graduate production.", "1983-12-10", null, "male", "images/actors/9de4d9c643a7fcafdc06757e9a24de41.jpg"],
        [63,7058, "Kris Marshall", "United Kingdom", "From Wikipedia, the free encyclopedia.Kristopher \"Kris\" Marshall (born 1 April 1973) is a British actor best known for his role as Nick Harper in My Family and as Adam in the adverts for BT since 2005.Description above from the Wikipedia article Kris Marshall, licensed under CC-BY-SA, full list of contributors on Wikipedia.", "1973-04-01", null, "male", "images/actors/cc06e8cee75b1627498145b79f54f6b3.jpg"],
        [64,1213279, "Ryan Corr", "", "", "1989-01-15", null, "female", "images/actors/8eb9d535d287099a59a319161336b18c.jpg"],
        [65,19996, "Kevin Bishop", "Orpington, London, England, UK", "Kevin Brian Bishop is an English actor and comedian, best known for The Kevin Bishop Show, which he co-wrote with Lee Hupfield.", "1980-06-18", null, "male", "images/actors/b96a11667535fd9b40ee9a90bc98cac3.jpg"],
        [66,17605, "Idris Elba", "Hackney, London, England, UK", "Idris Elba (born 6 September 1972) is a British television, theatre, and film actor who has starred in both British and American productions. One of his first acting roles was in the soap opera Family Affairs. Since then he has worked in a variety of TV and movie projects including Ultraviolet, The Wire, No Good Deed and Zootopia.", "1972-09-06", null, "male", "images/actors/4c13640524a2a8428b4ee55a3e5e0654.jpg"],
        [67,10297, "Matthew McConaughey", "Uvalde - Texas - USA", "Matthew David McConaughey (born November 4, 1969) is an American actor. After a series of minor roles in the early 1990s, McConaughey gained notice for his breakout role in Dazed and Confused (1993). It was in this role that he first conceived the idea of his catch-phrase \"Well alright, alright.\" He then appeared in films such as A Time to Kill, Contact, U-571, Tiptoes, Sahara, and We Are Marshall. McConaughey is best known more recently for his performances as a leading man in the romantic comedies The Wedding Planner, How to Lose a Guy in 10 Days, Failure to Launch, Ghosts of Girlfriends Past and Fool's Gold.Description above from the Wikipedia article Matthew McConaughey, licensed under CC-BY-SA, full list of contributors on Wikipedia.", "1969-11-04", null, "male", "images/actors/b3689f71adfabfa0c1e118277bfa8cef.jpg"],
        [68,1036288, "Abbey Lee", " Melbourne, Victoria, Australia", "Abbey Lee Kershaw (born 12 June 1987), known professionally as Abbey Lee, is an Australian fashion model, actress and musician. Following several years of success leading up to the 2011 fashion seasons, V magazine dubbed Kershaw a supermodel. Models.com has listed her as an \"Industry Icon\". Wikipedia", "1987-06-12", null, "female", "images/actors/a53baf6f5f4c7dce418f7a49cbaee564.jpg"],
        [69,26723, "Katheryn Winnick", "Toronto, Ontario, Canada", "As her impressively diverse list of credits attests, the beautiful Canadian-born Katheryn Winnick has always been drawn to the unconventional, showing range and depth with every role she plays.Winnick will next star as the fearless shield maiden, 'Lagertha', wife and warrior of a great Viking leader in the new eagerly-anticipated television series \"Vikings\". Produced by MGM and The History Channel, \"Vikings\" is an epic historical drama that chronicles legendary events of the medieval times, also starring Golden Globe Winner, Gabriel Byrne and Travis Fimmel. Winnick considers \"Vikings\" to be her most precious acting memories to date. This year alone, Winnick exemplifies her talent and diversity in roles when she appears as Charlie Sheen's ex in \"A Glimpse Inside the Mind of Charles Swan III\" (co starring Bill Murray, Patricia Arquette, and Jason Schwartzman); and alongside Al Pacino, Christopher Walken, and Alan Arkin in Lakeshore Entertainment's \"Stand Up Guys\".Recent career highlights include a sexy turn opposite Jake Gyllenhaal and Anne Hathaway in Ed Zwick's \"Love and Other Drugs\"; a fun, physically demanding role as one of the eponymous assassins in the Ashton Kutcher, Katherine Heigl action-comedy,\"Killers\" (in which Winnick did all her own stunts); a juicy recurring role as David Boreanaz's love interest on Fox's hit primetime TV series, \"Bones\"; and a subtly endearing performance in Sophie Barthes' \"Cold Souls\" (2009) alongside Academy Award-nominated co-stars Paul Giamatti, Emily Watson, and David Straitharn that resulted in a nod for 'Best Ensemble Cast' at that year's Independent Spirit Awards.Winnick demonstrates talent beyond the acting realm as an accomplished martial artist. After receiving her first Black Belt at the ripe old age of thirteen, she went on to compete in the Canadian Nationals, opened a handful of highly-successful Tae Kwon Do schools in and around Toronto, and - as if all that was not enough - eventually trained to become a licensed bodyguard. She currently holds a third-degree Black Belt in Tae Kwon Do and a second-degree Black Belt in Karate.", "1977-12-17", null, "female", "images/actors/9fbd1490cc764be95ee37435efc47b90.jpg"],
        [70,17183, "Jackie Earle Haley", "Northridge, California, U.S.", "Jackie Earle Haley (born Jack E. Haley; July 14, 1961) is an American film actor. Establishing himself from child actor to adult Academy Award-nominee, he is perhaps best known for his roles as Moocher in Breaking Away, Kelly Leak in The Bad News Bears, pedophile Ronnie McGorvey in Little Children, the vigilante Rorschach in Watchmen, as horror icon Freddy Krueger in the remake of A Nightmare on Elm Street, released on April 30, 2010, and most recently as Guerrero in Fox's drama Human Target.Description above from the Wikipedia article Jackie Earle Haley, licensed under CC-BY-SA, full list of contributors on Wikipedia​", "1961-07-14", null, "male", "images/actors/9733e4e8f5d010b63322c588f85b387f.jpg"],
        [71,1137, "Juliette Binoche", "Paris, France", "Juliette Binoche (born 9 March 1964) is a French actress, artist and dancer. She has appeared in more than 40 feature films, been recipient of numerous international accolades, is a published author and has appeared on stage across the world. Coming from an artistic background, she began taking acting lessons during adolescence. After performing in several stage productions, she was propelled into the world of auteurs Jean-Luc Godard (Hail Mary, 1985), Jacques Doillon (Family Life, 1985) and André Téchiné, who made her a star in France with the leading role in his 1985 drama Rendez-vous. Her sensual performance in her English-language debut The Unbearable Lightness of Being (1988), directed by Philip Kaufman, launched her international career.She sparked the interest of Steven Spielberg, who offered her several parts including a role in Jurassic Park which she declined, choosing instead to join Krzysztof Kieslowski on the set of Three Colors: Blue (1993), a performance for which she won the Venice Film Festival Award for Best Actress and a César. Three years later Binoche gained further acclaim in Anthony Minghella’s The English Patient (1996), for which she was awarded an Academy Award and a BAFTA for Best Supporting Actress in addition to the Best Actress Award at the 1997 Berlin Film Festival. For her performance in Lasse Hallström’s romantic comedy Chocolat (2000) Binoche was nominated for an Academy Award for Best Actress.During the 2000s she maintained a successful, critically acclaimed career, alternating between French and English language roles in both mainstream and art-house productions. In 2010 she won the Best Actress Award at the Cannes Film Festival for her role in Abbas Kiarostami’s Certified Copy making her the first actress to win the European “best actress triple crown”.Throughout her career Binoche has intermittently appeared on stage, most notably in a 1998 London production of Luigi Pirandello’s Naked and in a 2000 production of Harold Pinter's Betrayal on Broadway for which she was nominated for a Tony Award. In 2008 she began a world tour with a modern dance production in-i devised in collaboration with Akram Khan. Affectionately referred to as \"La Binoche\" by the French press, her other notable performances include: Mauvais Sang (1986), Les Amants du Pont-Neuf, Damage (1992), The Horseman on the Roof (1995), Code Unknown (2000), Caché (2005), Breaking and Entering (2006) and Flight of the Red Balloon (2007).Description above from the Wikipedia article Juliette Binoche, licensed under CC-BY-SA, full list of contributors on Wikipedia.", "1964-03-09", null, "female", "images/actors/51f67f11c57917842f1dc956e8ae7645.jpg"],
        [72,1348474, "Camille Cottin", "", "", "1978-12-01", null, "female", "images/actors/ae435f48b54e42a9f8edfda53a9bb5a9.jpg"],
        [73,2192, "Lambert Wilson", "Neuilly-sur-Seine, France", "From Wikipedia, the free encyclopedia.Lambert Wilson (born August 3, 1958) is a French actor. He is internationally known for his portrayal of The Merovingian in The Matrix movies.Description above from the Wikipedia article Lambert Wilson, licensed under CC-BY-SA, full list of contributors on Wikipedia.", "1958-08-03", null, "male", "images/actors/eb5b04a2e77cd16cb9f934a3486d0f95.jpg"],
        [74,1525010, "Stéfi Celma", "Paris - France", "Elle est née en 1986 à Paris de parents martiniquais.Elle se destine d'abord à la musique, en débutant sous les feux des projecteurs avec le conte musical Sol En Cirque, écrite par Zazie, en 20051. Elle participe ensuite au jukebox musical Je m'voyais déjà, écrite cette fois par Laurent Ruquier, et lancée en octobre 2008.Après quelques prestations dans des séries télévisées, elle décroche le premier rôle féminin de la comédie cinématographique Case départ, de Lionel Steketee, Fabrice Éboué et Thomas N'Gijol. Sorti en 2011, le long-métrage est un succès critique et commercial surprise.Elle enchaîne avec deux autres comédies, sorties toutes deux en 2013, et mises en scène par des anciens membres de la troupe comique des Robins des Bois : d'abord la parodie Pas très normales activités, de Maurice Barthélemy, dont elle partage l'affiche avec Norman Thavaud ; puis Les Profs, adaptation de la bande dessinée éponyme signée Pierre-François Martin-Laval, menée par une autre icône de la jeunesse, Kev Adams.Elle se diversifie en 2015 : d'abord en faisant partie de la distribution du film d'action Antigang, de Benjamin Rocher, puis en faisant partie du casting de la série télévisée Dix pour cent, co-produite par Cédric Klapisch.Elle revient aussi dans le rôle d'Amina, la prof de français, pour la suite The Profs 2, toujours de Pierre-François Martin-Laval.", "1986-10-09", null, "female", "images/actors/d976fb47074759d198b63e23dcc056ec.jpg"],
        [75,38898, "Jean-Luc Bideau", "", "", "1940-10-01", null, "female", "images/actors/87bcec8b1e7a62b398b732dedb9ce522.jpg"],
        [76,85, "Johnny Depp", "Owensboro, Kentucky, USA ", "John Christopher \"Johnny\" Depp II (born June 9, 1963) is an American actor and musician. He has won the Golden Globe Award and Screen Actors Guild award for Best Actor.Depp rose to prominence on the 1980s television series 21 Jump Street, becoming a teen idol. Turning to film, he played the title character of Edward Scissorhands (1990), and later found box office success in films such as Sleepy Hollow (1999), Pirates of the Caribbean: The Curse of the Black Pearl (2003), Charlie and the Chocolate Factory (2005), and Rango (2011). He has collaborated with director and friend Tim Burton in seven films, including Sweeney Todd: The Demon Barber of Fleet Street (2007) and Alice in Wonderland (2010). Depp has gained acclaim for his portrayals of people such as Edward D. Wood, Jr., in Ed Wood, Joseph D. Pistone in Donnie Brasco, Hunter S. Thompson in Fear and Loathing in Las Vegas, George Jung in Blow, and the bank robber John Dillinger in Michael Mann's Public Enemies.Films featuring Depp have grossed over $2.6 billion at the United States box office and over $6 billion worldwide. He has been nominated for top awards many times, winning the Best Actor Awards from the Golden Globes for Sweeney Todd: The Demon Barber of Fleet Street and from the Screen Actors Guild for Pirates of the Caribbean: The Curse of the Black Pearl. He also has garnered a sex symbol status in American cinema, being twice named as the Sexiest man alive by People magazine in 2003 and 2009.Description above from the Wikipedia article Johnny Depp, licensed under CC-BY-SA, full list of contributors on Wikipedia.", "1963-06-09", null, "male", "images/actors/e51e53174fed3eb12a9050d5246a99b8.jpg"],
        [77,3810, "Javier Bardem", "Las Palmas de Gran Canaria, Gran Canaria, Canary Islands, Spain", "Javier Ángel Encinas Bardem is a Spanish actor from the Canary Islands. He is best known for his role in the 2007 film No Country for Old Men, for which he won the Academy Award for Best Supporting Actor portraying the psychopathic assassin Anton Chigurh. He has also received critical acclaim for roles in films such as Jamón, jamón, Carne trémula, Boca a boca, Los Lunes al sol, Mar adentro, and Skyfall, for which he received both a BAFTA and a SAG nomination for Best Supporting Actor.Bardem has also won a Screen Actors Guild Award, a BAFTA, five Goya Awards, two European Film Awards, a Prize for Best Actor at Cannes and two Volpi Cups at Venice for his work. He is the first Spaniard actor to be nominated for an Oscar (Best Actor, 2000, for Before Night Falls), as well as the first Spanish actor to win an Academy Award. He received his third Academy Award nomination, and second Best Actor nomination, for the film Biutiful.", "1969-03-01", null, "male", "images/actors/9ebe6f34838f0cfc6e9948873ae5b1df.jpg"],
        [78,1017347, "Brenton Thwaites", "Cairns, Queensland, Australia", "Brenton Thwaites is an Australian actor, best known for portraying Luke Gallagher in the Fox8 teen drama series, SLiDE, and Stu Henderson in the soap opera Home and Away. Thwaites starred in The Giver as one of the male leads, Jonas, opposite Jeff Bridges and Meryl Streep.Thwaites was born in Cairns, Queensland, in 1989 to Peter and Fiona Thwaites. He has a sister, Stacey. He underwent secondary education at Cairns State High School in Far North Queensland, with his senior year held in 2006. He studied acting at the Queensland University of Technology and he graduated in 2010. He then relocated to Sydney to join the long-running soap opera Home and Away and to pursue his career in acting.", "1989-08-10", null, "male", "images/actors/5f9bd8a0f10cf3922203f4f48de56be0.jpg"],
        [79,115150, "Kaya Scodelario", " London, England", "Kaya Scodelario was born in London, England. Right away, there was something different about her. Although she had a British upbringing, Kaya Scodelario had Brazilian roots and she spent time learning Portuguese until she was fluent in the language. At the age of 14, Kaya Scodelario decided to pursue acting and she auditioned for Skins, the debut series for new channel E4. Amazingly, Kaya Scodelario won the role of Effy despite the fact that she had no other acting experience to speak of. Maybe it was a stroke of luck or a glimpse of raw natural talent, but either way, Kaya Scodelario was pleased to have the opportunity and joined the show in January 2007. After an inauspicious debut in which she had no lines, Kaya Scodelario's role of Effy proved to be quite a test. At the forefront of many disasters, including stalkers, death and sexual pressures, Effy became a fan favourite for her ability to somehow resolve testing life situations while keeping her head above water. As the role became more challenging, Kaya Scodelario came to like it even more since she likened Effy's difficulties and loss of friends to real life. After two seasons of Skins, the series endured an overhaul at the end of 2007. Feeling that most of the characters had run their course, every character was written out of the series except for Effy. This was a significant change because it meant that Kaya Scodelario would be the most recognizable face for season three. As Kaya Scodelario waited for the new season of Skins to begin, she has taken advantage of her recent clout to seek out additional career opportunities. She joined the elite agency Models 1 and soon had a photo-op as the cover model for SUPERSUPER Magazine. Kaya Scodelario may be fostering her modeling career, but she is also making her feature film debut with a role in the 2009 film Moon. It stars Sam Rockwell as an astronaut suffering from surreal encounters while on the lunar planet.", "1992-02-13", null, "female", "images/actors/7e1e33d801e40be88d8c9cd378bd7fde.jpg"],
        [80,2449, "Kevin McNally", "Bristol, England, UK", "Kevin McNally was born on April 27, 1956, in Bristol, England. He grew up in Birmingham where he attended Redhill and Mapledene Junior schools and Central Grammar School for Boys. At the age of 16, he got his first job at Birmingham Repertory Theatre. A year later he received a scholarship to the Royal Academy of Dramatic Art. In 1975 he won the Best Actor Bancroft Gold Medal for his stage performance. McNally's most notable stage performances in London's West End include his appearance as Alan Bennett opposite Maggie Smith in 'The Lady in the Van' and opposite Juliette Binoche in 'Naked'. He also starred as Richard in Terry Johnson's 'Dead Funny' at the Savoy Theatre.Since 1976 McNally has been involved in numerous TV productions beginning with his portrayal of the Roman ruler Castor, son of Tiberius, in the acclaimed BBC history series I, Claudius (1976) and his portrayal of Drake Carne in the popular series Poldark (1975). His career on television ascended after his work in Masada (1981) and in the cult TV series Doctor Who: The Twin Dilemma (1984). During the 1980s and 1990s McNally established himself as a reputable and versatile actor on both the British and American TV. He played a broad variety of leading and supporting characters ranging from the Soviet politician Kirov in Stalin (1992) to homicide detective Jack Taylor in Chiller (1995), and from an insecure son, Alan Hook, in TV series Dad (1997) to a convicted murderer James Hopkin in Bloodlines (2005). His portrayal of Frank Worsley in Shackleton (2002) as well as the role of Harry Woolf in Life on Mars (2006)  are among his best known works for television.  Between 2011 - 2012 he appeared in three episodes of Downton Abbey as Horrace Bryant.In 1977 McNally made his big screen debut as HMS Ranger Crewman in the James Bond adventure The Spy Who Loved Me (1977). After having played bit parts in more than twenty feature films, McNally shot to international fame as pirate Joshamee Gibbs, his best known film role, in Pirates of the Caribbean: The Curse of the Black Pearl (2003) and the sequel Pirates of the Caribbean: Dead Man's Chest (2006). He returned in the role Joshamee Gibbs in the third installment of the 'Pirates' franchise Pirates of the Caribbean: At World's End (2007).Kevin McNally has been enjoying a happy family life with Scottish actress Phyllis Logan and his two children. He resides with his family in Chiswick, London, England.", "1956-04-27", null, "male", "images/actors/dbd136a24a3bf7574c225d55b4a71d94.jpg"],
        [81,1333, "Andy Serkis", "Ruislip, Middlesex, UK", "Andrew \"Andy\" Clement Serkis (born 20 April 1964) is an English film actor and director. He is best known for his performance capture roles comprising motion capture acting, animation and voice work for such computer-generated characters as Gollum in The Lord of the Rings film trilogy (2001–2003) and The Hobbit: An Unexpected Journey (2012), King Kong in the eponymous 2005 film, Caesar in the Planet of the Apes reboot series (2011–17), Captain Haddock / Sir Francis Haddock in Steven Spielberg's The Adventures of Tintin (2011), and Supreme Leader Snoke in Star Wars: The Force Awakens (2015). Upcoming performance capture roles include Supreme Leader Snoke in Star Wars: The Last Jedi (2017), and Baloo in Jungle Book (2018).Serkis's film work in motion capture has been critically acclaimed. He has received an Empire Award, and two Saturn Awards for his motion-capture acting. He earned a Golden Globe nomination for his portrayal of serial killer Ian Brady in the British television film Longford (2006) and was nominated for a BAFTA for his portrayal of new wave and punk rock musician Ian Dury in the biopic Sex & Drugs & Rock & Roll (2010).In 2015, he began playing Ulysses Klaue in the Marvel Cinematic Universe beginning with Avengers: Age of Ultron. Serkis has his own motion capture workshop, The Imaginarium Studios in London, which he used for Jungle Book. He made his directorial debut with the 2017 film Breathe.Description above from the Wikipedia article Andy Serkis, licensed under CC-BY-SA, full list of contributors on Wikipedia.", "1964-04-20", null, "male", "images/actors/8af14269d2c32aab2a6610733b00b7d7.jpg"],
        [82,57755, "Woody Harrelson", "Midland, Texas, USA", "Woodrick Tracy \"Woody\" Harrelson (born July 23, 1961) is an American actor and comedian. Harrelson's breakthrough role came in the television sitcom Cheers as bartender Woody Boyd. Notable film characters include basketball hustler Billy Hoyle in White Men Can't Jump, bowler Roy Munson in Kingpin, serial killer Mickey Knox in Natural Born Killers, magazine publisher Larry Flynt in The People vs. Larry Flynt, country singer Dusty in A Prairie Home Companion, bounty hunter Carson Wells in No Country for Old Men, zombie killer Tallahassee in Zombieland, blind piano player/meat salesman Ezra Turner in Seven Pounds, conspiracy nut Charlie Frost in 2012, a delusional man who believes that he is a superhero named Defendor in Defendor and Cpt. Tony Stone in The Messenger. For The People vs. Larry Flynt and The Messenger, Harrelson earned Academy Award nominations for Best Actor and Best Supporting Actor, respectively.Description above from the Wikipedia article Woody Harrelson, licensed under CC-BY-SA, full list of contributors on Wikipedia.", "1961-07-23", null, "male", "images/actors/e740f771b82bc065d2143534f46ef295.jpg"],
        [83,18324, "Steve Zahn", "Marshall, Minnesota, USA", "Steven James \"Steve\" Zahn ( born November 13, 1967) is an American comedian and film and stage actor.Description above from the Wikipedia article Steve Zahn, licensed under CC-BY-SA, full list of contributors on Wikipedia.", "1967-11-13", null, "male", "images/actors/e311135c57b6e77e31f7dfdad2557bdb.jpg"],
        [84,58395, "Karin Konoval", "Baltimore - Maryland - USA", "Karin Konoval has appeared in guest starring roles in numerous TV series and supporting lead roles in many feature films. Her extensive screen credits include \"Maurice the Orangutan\" in Rise Of The Planet Of The Apes and Dawn Of The Planet Of The Apes, \"Mrs. Peacock\" in the infamous X-Files episode Home, and the lead role of \"Mary Leonard\" in the feature Cable Beach, for which she received a Philip Borsos award. She has received numerous awards for her work in theatre, performing lead roles in contemporary classics and a wide range of musicals.Born in Baltimore, Maryland, Karin Konoval moved to Canada with her family as a child and grew up in Edmonton, Alberta where she originally trained as a dancer. After graduating from the University of Alberta with a B.A. in theatre history, she moved to Vancouver, British Columbia to pursue a career in acting. Her writing has been published in various anthologies and literary magazines and broadcast on CBC Radio. As an artist she has had many solo gallery exhibits of her paintings for a growing audience.- IMDb Mini Biography By: King Talent", null, null, "female", "images/actors/88e9e59a35b1d66df393ef2636c0bd9c.jpg"],
        [85,236696, "Terry Notary", "San Rafael, USA", "frome Wikipedia Terry Notary is an American actor, stunt coordinator/double and movement coach. Born in San Rafael, California, Notary was in gymnastics class in school and won many State Championships. Later in his 20's, he was a performer at Cirque du Soleil, shortly after he joined, he met his wfe Rhonda in New York. Notary mainly portrays creatures and animals for the film and television industry. He is also a motion capture performer in films like The Adventures of Tintin: Secrets of the Unichorn, Rise of the Planet of the Apes and Avatar. He now lives with his wife and his two daughters.", null, null, "female", "images/actors/e028a405fbbf0f6e6bc5414abe7077ae.jpg"],
        [86,1136406, "Tom Holland", "Kingston upon Thames, Surrey, England, UK", "Thomas Stanley \"Tom\" Holland (1st June 1996) is an English actor and dancer. He is best known for playing the title role in Billy Elliot the Musical at the Victoria Palace Theatre, London, as well as for starring in the 2012 film The Impossible. In 2015, Holland was cast as Peter Parker / Spider-Man in the Marvel Cinematic Universe ", "1996-06-01", null, "male", "images/actors/69e5871e8d8fb4278535c7b1510e62ac.jpg"],
        [87,2232, "Michael Keaton", "Coraopolis - Pennsylvania - USA", "Michael John Douglas (born September 5, 1951), better known as Michael Keaton, is an American actor, well known for his early comedic roles in films such as Night Shift, Mr. Mom, Johnny Dangerously, Beetlejuice, and for his dramatic portrayal of Batman in Tim Burton's Batman and Batman Returns, as well as lead roles in other films including The Paper, Jackie Brown, Jack Frost, White Noise, Cars, The Other Guys and Toy Story 3.", "1951-09-05", null, "male", "images/actors/a707f792b7af670ab70990a84c0d90ce.jpg"],
        [88,1606394, "Laura Harrier", "", "Laura Harrier is an American actress and model.", null, null, "female", "images/actors/388664e56da36342946bb21b1ccc9682.jpg"],
        [89,1649152, "Jacob Batalon", "Honolulu, Hawaii, USA", "", "1996-06-06", null, "male", "images/actors/c551e0ff9bbcc89c8110762ea2a19a67.jpg"],
        [90,505710, "Zendaya", "Oakland, California, USA", "Zendaya Maree Stoermer Coleman, known simply as Zendaya, is an American actress, singer and dancer. She began performing at an early age with the dance group Future Shock Oakland, the California Shakespeare Theater in Orinda, and as part of her studies at the Oakland School for the Arts and Cal Shakes Summer Conservatory Program. While she was in her early teens, she embarked on her entertainment career, graduating from modeling work for Macy's and Old Navy to appearing in the video for Kidz Bop's version of Katy Perry's hit single, \"Hot N Cold\".Late in 2009, she auditioned for the Disney Channel series eventually known as \"Shake It Up!\", landing the role of Rocky Blue. Several of the songs she performed on the show were released as singles, including 2011's \"Watch Me,\" a duet with her co-star Bella Thorne that charted at number 86 on the Billboard Hot 100. That year, she also released the single \"Swag It Out\". Zendaya parlayed her \"Shake It Up!\" success into a role in the 2012 Disney Channel original movie Frenemies alongside Thorne, and hosting Make Your Mark: The Ultimate Dance Off 2011. That year, more of Zendaya's songs were featured on the second season of \"Shake It Up!\" and the soundtrack Shake It Up: Live 2 Dance. After signing a deal with Disney imprint Hollywood Records, she began work on her first solo album.Early in 2013, Zendaya was cast on the sixteenth season of ABC's \"Dancing with the Stars\", becoming the show's youngest contestant at 16 and placing runner-up. That July, \"Shake It Up!\" concluded, and in the following months, the book Between U and Me and her debut album Zendaya arrived. The album's lead single \"Replay\" was released on July 16, 2013, reached number 40 on the Billboard Hot 100, number 18 in New Zealand, and was certified platinum by the RIAA on January 30, 2014. The self-titled debut album was released on September 17 and peaked at #51 on the Billboard 200. In 2017, Zendaya played Michelle 'MJ' Jones in Spider-Man: Homecoming.", "1996-09-01", null, "female", "images/actors/5ae31d2b8ee8558ddec91f1bd531df63.jpg"],
        [91,21200, "Will Arnett", "Toronto, Ontario, Canada", "William Emerson \"Will\" Arnett (born May 4, 1970) is a Canadian actor and comedian best known for roles as George Oscar \"G.O.B.\" Bluth II on the Fox comedy Arrested Development and as Devon Banks on the NBC comedy 30 Rock. Since his success on Arrested Development, Arnett has landed major film roles. He recently played supporting roles in the comedy films Semi-Pro, Blades of Glory, and Hot Rod. He starred in 2006's Let's Go to Prison and 2007's The Brothers Solomon. Arnett has also done work as a voiceover artist for commercials, films, television programs, and video games.Description above from the Wikipedia article Will Arnett, licensed under CC-BY-SA, full list of contributors on Wikipedia.", "1970-05-04", null, "male", "images/actors/3b1be002a79533232af1144fe9c96669.jpg"],
        [92,25541, "Katherine Heigl", "Washington, D.C., U.S.", "Katherine Marie Heigl, born on November 24, 1978, is an American actress. She is best known for her role as Dr. Izzie Stevens on Grey's Anatomy and her starring role in the movies Knocked Up, Zyzzyx Road, 27 Dresses, The Ugly Truth, Killers and Life As We Know It.Heigl started her career as a child model with Wilhelmina Models before she turned her attention to acting. She made her debut in the coming-of-age film, That Night. Heigl co-starred as Isabel Evans in the television series Roswell and movies including My Father the Hero before landing her break out role in Grey's Anatomy.Over the years, Heigl has established herself as a cover model appearing on numerous publications including Maxim, Vanity Fair and Cosmopolitan. Heigl married Josh Kelley in Park City, Utah, on December 23, 2007.Heigl appeared as Christina Sebastian in Steven Soderbergh's Depression-era drama King of the Hill before being cast in her first leading role in the 1994 comedy My Father the Hero. In 1995, she starred in the Steven Seagal action thriller Under Siege 2: Dark Territory. Despite an increased focus on acting, she still modelled extensively, appearing regularly in magazines such as Seventeen. She took the lead role in Disney's made-for-television film Wish Upon a Star in 1996. Also in 1996, Heigl's parents divorced and her mother was diagnosed with cancer. In 1998, she co-starred with Peter Fonda in a re-working of the classic Shakespearian play The Tempest, set during the American Civil War. Later that year, she starred in the horror film Bride of Chucky.Heigl was frequently featured in photo essays in magazines such as Life, TV Guide, and Teen as well as FHM. She appeared in the FHM and Maxim calendars, FHM's annual \"100 Sexiest Women in the World\", and was featured in the Girls of Maxim Gallery. In May 2006, Maxim awarded her #12 on their annual Hot 100 List as well as voted the 19th \"Sexiest Woman in the World\" by readers of FHM magazine.While Roswell was in production, Heigl worked on several films, including 100 Girls, an independent 2001 film, and Valentine, a horror film starring David Boreanaz and Denise Richards. On September 16, 2007, Heigl won an Emmy for Outstanding Supporting Actress in a Drama Series for her role as Izzie Stevens. In 2009, Heigl starred opposite Gerard Butler in The Ugly Truth, which opened July 24. Heigl finished filming the Lionsgate thriller Killers, opposite Ashton Kutcher, and it was released June 4, 2010.She has signed on to star in and produce the big-screen drama Life As We Know It. Life As We Know It revolves around a woman and a man whose respective best friends die in a car accident. Following the tragedy, they are left to share in caring for the deceased's orphaned daughter. Everwood creator Greg Berlanti will direct the film.", "1978-11-24", null, "female", "images/actors/b7feeafaa0ffd0df07a23471d0636dce.jpg"],
        [93,452205, "Bobby Moynihan", "", "Bobby grew up in Eastchester, New York, where he attended Eastchester Public Schools. He was actively engaged in art but was no stranger to the stage, starring in such Eastchester Youth Council productions of Fiddler on the Roof and the Producers.You may remember Bobby dancing in black tights from SNL's spoof of Beyoncee's \"Single Ladies\", but he had prior experience dancing in Eastchester Jazz Co. in High School.He is now a regular Cast member of Saturday Night Live, and a (relatively) functional member of society.", "1978-01-31", null, "male", "images/actors/eb01dbb2270c1d900cb9073d5a183be2.jpg"],
        [94,53, "Peter Stormare", "Arbrå, Gävleborgs län, Suède", "Peter Stormare (born Rolf Peter Ingvar Storm; 27 August 1953) is a Swedish film, stage, voice and television actor as well as a theatrical director, playwright and musician. He is perhaps best known for his roles as John Abruzzi in Prison Break and as Gaear Grimsrud, one of the two kidnappers in Fargo.Peter Stormare began his acting career at the Royal National Theatre of Sweden, performing for eleven years. In 1990 he became the Associate Artistic Director at the Tokyo Globe Theatre and directed productions of many Shakespeare plays, including \"Hamlet\". In 1993 he moved to New York, where he appeared in English productions. He continues to work in both the United States and his his homeland of Sweden. He resides in Los Angeles, California, USA, with his wife.", "1953-08-27", null, "male", "images/actors/9db3599c2425dd2019662b93d14e1b8f.jpg"],
        [95,122889, "Dane DeHaan", "Allentown, Pennsylvania, USA ", "Dane William DeHaan is an American actor. He is known for playing Jesse on the HBO series In Treatment, and for his roles in the films Chronicle (2012), The Place Beyond the Pines (2013), Kill Your Darlings (2013), The Amazing Spider-Man 2 (2014) and Life (2015).", "1987-02-06", null, "male", "images/actors/a0c6b3690360c3d3ad049fe024f7e364.jpg"],
        [96,1289968, "Cara Delevingne", "London, England", "Cara Jocelyn Delevingne (/ˈkɑːrə ˌdɛləˈviːn/ kah-rə del-ə-veen; born 12 August 1992) is an English fashion model and actress. She signed with Storm Model Management after leaving school in 2009. Delevingne won the \"Model of the Year\" award at the British Fashion Awards in 2012 and 2014 and has appeared in shows for houses including Burberry, Mulberry, Dolce & Gabbana, and Jason Wu. She started her acting career with a minor role in the 2012 film adaptation of Anna Karenina. Her first major roles were as Margo Roth Spiegelman in the romantic mystery film Paper Towns (2015), Kath Talent in London Fields, and the Enchantress in the comic book film Suicide Squad (2016).", "1992-08-12", null, "female", "images/actors/fd0dbf04aa6fdf7398ab1dd91508cce2.jpg"],
        [97,2296, "Clive Owen", "Keresley, Coventry, Warwickshire, England, UK", "Clive Owen (born 3 October 1964) is an English actor, who has worked on television, stage and film. He first gained recognition in the United Kingdom for portraying the lead in the ITV series Chancer from 1990 to 1991. He then garnered critical acclaim for his work in the film Close My Eyes (1991) before getting international notice for his performance as a struggling writer in Croupier (1998). In 2005, Owen won a Golden Globe and a BAFTA Award and was nominated for an Academy Award for Best Supporting Actor for his appearance in the drama Closer (2004). He has since played leading as well as supporting roles in films such as Sin City (2005), Inside Man (2006), Children of Men (2006), and The International (2009).Description above from the Wikipedia article Clive Owen, licensed under CC-BY-SA, full list of contributors on Wikipedia", "1964-10-03", null, "male", "images/actors/eb1aba12d3ed761fbab7bcb3a541905a.jpg"],
        [98,131519, "Rihanna", "Saint Michael, Barbados", "From Wikipedia, the free encyclopedia Robyn Rihanna Fenty (born February 20, 1988), known by her stage name Rihanna, is a Barbadian recording artist, actress and fashion designer. She began her career as a result of meeting record producer Evan Rogers in late 2003. She has appeared in numerous music videos and motion pictures. Her videography includes thirty-five music videos, two guest appearances in other artists' videos, one video album, five film appearances and eight television commercials.", "1988-02-20", null, "female", "images/actors/bd506b7ce902aa5940ea697721314dc4.jpg"],
        [99,569, "Ethan Hawke", "Austin, Texas, USA", "Ethan Green Hawke (born November 6, 1970) is an American actor, writer and director. He made his feature film debut in 1985 with the science fiction movie Explorers, before making a supporting appearance in the 1989 drama Dead Poets Society which is considered his breakthrough role. He then appeared in such films as White Fang (1991), A Midnight Clear (1992), and Alive (1993) before taking a role in the 1994 Generation X drama Reality Bites, for which he gained critical acclaim. In 1995, he starred in the romantic drama Before Sunrise, and later in its sequel Before Sunset (2004).In 2001, Hawke was cast as a rookie police officer in Training Day, for which he received a Screen Actors Guild and Academy Award nomination in the Best Supporting Actor category. Other films have included the science fiction feature Gattaca (1997), the title role in Michael Almereyda's Hamlet (2000), the action thriller Assault on Precinct 13 (2005), and the crime drama Before the Devil Knows You're Dead (2007).Hawke has appeared in many theater productions including The Seagull, Henry IV, Hurlyburly, The Cherry Orchard, The Winter's Tale and The Coast of Utopia, for which he earned a Tony Award nomination. He made his directorial debut with the 2002 independent feature Chelsea Walls. In November 2007 Hawke directed his first play, Jonathan Marc Sherman's Things We Want. Aside from acting, he has written two novels, The Hottest State (1996) and Ash Wednesday (2002). Between 1998 and 2004, Hawke was married to actress Uma Thurman.Description above from the Wikipedia article Ethan Hawke, licensed under CC-BY-SA, full list of contributors on Wikipedia.", "1970-11-06", null, "male", "images/actors/d2161609a675c3ef8f086ebd083aa44e.jpg"],
        [100,1159982, "Ansel Elgort", "Manhattan, New York, USA", "Ansel Elgort (born March 14, 1994) is an American actor, singer and a DJ (under the name Ansølo). As a film actor, he is known for playing Tommy Ross in Carrie (2013), Caleb Prior in The Divergent Series (2014), Augustus Waters in The Fault in Our Stars (2014), and Baby in Baby Driver (2017).", "1994-03-14", null, "male", "images/actors/c91a81f65a94365e7c54e04c17e4353d.jpg"],
        [101,1016168, "Lily James", "Esher, Surrey, England", "Lily Chloe Ninette Thomson (born 27 December 1989), known as Lily James, is an English actress. She played Lady Rose Aldridge in the ITV period drama Downton Abbey and the title role in the 2015 Disney film Cinderella.In 2011, James played Taylor in Vernon God Little at the Young Vic Theatre in Tanya Ronder's stage adaptation of the novel Vernon God Little directed by Rufus Norris, Nina in a modern adaptation of The Seagull at Southwark Playhouse, and Desdemona in Daniel Evans production of Othello at the Crucible Theatre, Sheffield, alongside Dominic West and Clarke Peters. Quentin Letts wrote in The Daily Mail: \"We may have a new star actress on our hands.... She left drama school only last year, yet she practically sweeps all before her as Desdemona in this Othello. Poise, diction, allure – she has them all. ... Her character’s love affair with a much older husband is completely believable\".In 2012, James played the role of Katrina in Play House and Marijka in Definitely the Bahamas in a double bill written and directed by Martin Crimp at the Orange Tree Theatre in Richmond, London as part of the theatre's fortieth anniversary. Charles Spencer of The Telegraph wrote that \"it is performed with a persuasive mixture of mischief and deeper feeling by Obi Abili and Lily James, the latter combining a mixture of neuroticism and glowing sexual allure that proves extraordinarily potent.\"Also in 2012, James played the role of Korrina in Warner Brothers' Wrath of the Titans and starred in Fast Girls, written by Noel Clarke, centered around a group of young female athletes competing in the World Championships. Her television credits include Ethel Brown in the 2010 BBC production of Richmal Crompton's Just William, Poppy in the fourth season of ITV's Secret Diary of a Call Girl (2011), and the rebellious Lady Rose in the last episode of series three, later becoming a main character in the fourth and fifth seasons of the popular British series Downton Abbey. James played the title character in the 2015 live-action Disney film version of Cinderella.The film was released on 13 March 2015. James, as Cinderella, was photographed by Annie Leibovitz, in the blue gown that she wears to the ball, for the December 2014 issue of Vogue.", "1989-04-05", null, "female", "images/actors/36ba14be207a328343f01220c8e030bb.jpg"],
        [102,1979, "Kevin Spacey", "South Orange, New Jersey, USA", "Kevin Spacey Fowler (born July 26, 1959), better known by his stage name Kevin Spacey, is an American actor of screen and stage, film director, producer, screenwriter and singer who has resided in the United Kingdom since 2003. He began his career as a stage actor during the 1980s before obtaining supporting roles in film and television. He gained critical acclaim in the early 1990s that culminated in his first Academy Award for Best Supporting Actor for the neo-noir crime thriller The Usual Suspects (1995), and an Academy Award for Best Actor for midlife crisis-themed drama American Beauty (1999).His other starring roles have included the comedy-drama film Swimming with Sharks (1994), psychological thriller Seven (1995), the neo-noir crime film L.A. Confidential (1997), the drama Pay It Forward (2000), the science fiction-mystery film K-PAX (2001), and the role of Lex Luthor in the superhero film Superman Returns (2006).Description above from the Wikipedia article Kevin Spacey, licensed under CC-BY-SA, full list of contributors on Wikipedia.", "1959-07-26", null, "male", "images/actors/1efed17112678701c828ec9e3f712959.jpg"],
        [103,134, "Jamie Foxx", "Terrell, Texas, USA", "Eric Marlon Bishop (born December 13, 1967), professionally known as Jamie Foxx, is an American actor, singer-songwriter, stand-up comedian, and talk radio host. As an actor, his work in the film Ray earned him the Academy Award and BAFTA Award for Best Actor as well as the Golden Globe Award for Best Actor in a musical/comedy. He is also a Grammy Award winning musician, producing two albums which have charted highly on the Billboard 200: Unpredictable, which topped the chart, and Intuition.Foxx was abandoned seven months after birth, and was subsequently adopted and raised in Terrell by his mother's adoptive parents, Estelle and Mark Talley. Foxx had a strict Baptist upbringing and began piano lessons at the age of five by his grandmother's orders. He has often acknowledged his grandmother's influence in his life as one of the greatest reasons for his success. When he found that female comedians were often called first to perform, he changed his name to Jamie Foxx, feeling that it was an ambiguous enough name to disallow any biases. He chose his surname as a tribute to comedian Redd Foxx.From 1996 to 2001, Foxx starred in his own sitcom The Jamie Foxx Show, and in 1992 he made his film debut in Toys a comedy directed by Barry Levinson. Following Toys, his first dramatic role came in Oliver Stone's 1999 film Any Given Sunday, where he portrayed a hard-partying American football player. Foxx has since evolved into a respected dramatic actor. Foxx was featured as taxi driver Max Durocher in the film Collateral alongside Tom Cruise, for which he received outstanding reviews and a nomination for the Academy Award for Best Supporting Actor. His standout performance, however, was his portrayal of Ray Charles in the biopic Ray (2004), for which he won the Academy Award for Best Actor and the BAFTA Award for Best Actor in a Leading Role. Foxx is the second male in history to receive two acting Oscar nominations in the same year for two different movies, Collateral and Ray.In September 2007, Foxx was awarded a star on the Hollywood Walk of Fame.", "1967-12-13", null, "male", "images/actors/fd0f5631fb1d5473ad3f3ace748922ff.jpg"],
        [104,65717, "Jon Hamm", "St. Louis, Missouri, USA", "Jonathan Daniel \"Jon\" Hamm (born March 10, 1971) is an American actor who works primarily in television. For much of the mid-1990s, Hamm lived in Los Angeles as a struggling actor appearing in small parts in multiple television series, including Providence, The Division, What About Brian and Related. In 2000 he made his feature film debut in Clint Eastwood's space adventure, Space Cowboys. The following year, Hamm appeared in the independent comedy, Kissing Jessica Stein (2001) in a minor role.Hamm gained global recognition for playing advertising executive Don Draper in the AMC drama series Mad Men, which premiered in July 2007. Hamm's performance earned him a Golden Globe Award for Best Actor in a Drama Series in 2008. Aside from his work on Mad Men, Hamm appeared in the 2008 science fiction remake, The Day the Earth Stood Still and claimed his first leading film role in the independent thriller Stolen (2010). Hamm had a supporting role in the 2010 crime film The Town.Description above from the Wikipedia article Jon Hamm, licensed under CC-BY-SA, full list of contributors on Wikipedia.", "1971-03-10", null, "male", "images/actors/80ce06684307c3d90e845992dff0c06a.jpg"],
    ];
